import React from "react";
import { Grid, Stack, Typography, Box } from "@mui/material";
import { Container } from "@mui/material";
import Link from "@mui/material/Link";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import style from "../../styles/css/style.css";
import { CommonHeader, CommonDes } from "../../styles/theme";
import { CardHeader } from "../../styles/products";
import cardImg from "../../images/card-sample.png";

export default function ProductsList() {
  return (
    <>
      <Container>
        <Grid container>
          <Grid item md={12} sm={12} xm={12} lg={12}>
            <Box component="div" className="port-content">
              <CommonHeader className="CommonHeader">
                Plans and Products
              </CommonHeader>
            </Box>
          </Grid>
          <Grid item md={12} sm={12} xm={12} lg={12}>
            <Box component="div" sx={{ paddingY: "10px" }}>
              <CommonDes>Plans and Products</CommonDes>
            </Box>
          </Grid>
        </Grid>

        <Grid container spacing={3}>
          <Grid item md={3} sm={4} xm={12} lg={2}>
            <Box component="div" sx={{ paddingY: "20px" }}>
              <Link href="/menulist">
                <Card
                  elevation={3}
                  sx={{
                    boxSizing: "border-box",
                    padding: "0px",
                    borderRadius: "0px",
                    transition: "0.5s ease 0s, transform 0.5s ease 0s;",
                  }}
                  className="zoomer"
                >
                  <CardMedia
                    component="img"
                    height="140"
                    sx={{ padding: "5px" }}
                    image={cardImg}
                    alt="Order Online"
                  />
                  <CardContent>
                    <CardHeader>Order Online</CardHeader>
                  </CardContent>
                </Card>
              </Link>
            </Box>
          </Grid>
        </Grid>
      </Container>
    </>
  );
}
